(function(){"use strict";addEventListener("message",o=>{const a=o.data.imageData,t=o.data.transformMatrix;for(let d=0;d<a.data.length;d+=4){let e=a.data[d]/255,r=a.data[d+1]/255,n=a.data[d+2]/255;e=e*t[0]+r*t[1]+n*t[2],r=e*t[3]+r*t[4]+n*t[5],n=e*t[6]+r*t[7]+n*t[8],a.data[d]=Math.round(e*255),a.data[d+1]=Math.round(r*255),a.data[d+2]=Math.round(n*255)}postMessage({imageData:a},[a.data.buffer])})})();
